import NavBar from "./NavBar";
const About = ()=>{
    return (
        <>
            <NavBar/>
            <div className="home">
                <ul className="social_networks">
                    <li>Facebook</li>
                    <li>Instagram</li>
                    <li>LinkedIn</li>
                    <li>Twitter</li>
                </ul>
                <img src="image/photo.jpg" alt="not found" />
                <div className="right_side">
                    <h1> ABOUT ME</h1>
                    <p className="first">Hello my name is Nand Makadia</p>
                    <p>I am a MERN stack Web developer</p>
                    <p>I am currently Persuing Computer Engineering</p>
                    <p>Till now, I have completed a few Project on React.Js <br /> as mentioned in my Portfolio</p>
                    <button className="btn">DOWNLOAD CV</button>
                </div>
            </div>
        </>
        
    );
};
export default About;
